pragma solidity ^0.8.7;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Capped.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";


contract ERC20Token is ERC20Capped , ERC20Burnable{
    /* State variables*/
    address  payable immutable i_owner;
    uint256 public immutable i_totalSupply;
    string public s_TokenName;
    string public s_TokenSYM;
    uint256 public  _cap;
    uint256 public blockReward;
    address public TokenAddress;

    constructor(
        uint256 initalSupply,
        string memory TokenName,
        string memory TokenSYM,
        uint256 cap,
        uint256 reawrd
        ) 
        ERC20(TokenName,TokenSYM) ERC20Capped(cap) {
        i_owner=payable(msg.sender);
        s_TokenName=TokenName;
        s_TokenSYM=TokenSYM;
        _cap=cap;
        blockReward=reawrd;
        i_totalSupply = initalSupply;
        _mint(msg.sender,initalSupply);
        TokenAddress=address(this);
    }

    function burn(uint256 amount) public virtual override OnlyOwner {
        _burn(_msgSender(), amount);
    }

    function _mintMinerRewards() internal{
        _mint(block.coinbase, blockReward);
    }

    function _beforeTokenTransfer(address from, address to, uint256 value) internal virtual override {
        if(from != address(0) && to != block.coinbase && to != address(0))
        {
            _mintMinerRewards();
        }
        super._beforeTokenTransfer(from,to,value);
    }

    function _mint(address account, uint256 amount) internal virtual override (ERC20Capped,ERC20) {
        require(ERC20.totalSupply() + amount <= cap(), "ERC20Capped: cap exceeded");
        super._mint(account, amount);
    }

    function _blockReward(uint256 reward) public OnlyOwner{
        blockReward=reward;
    }

    modifier OnlyOwner(){
        require(msg.sender==i_owner,"Your not the Owner of the contract");
        _;
    }


}","keccak256":"0x48b626310b318ea8baf9a54a1e9f762314581ab49ba9efcd178bf0a738a03ec1","license":"MIT"},"contracts/FundContract.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;
import "./ERC20Token.sol";

contract FundContract{

    string public ContractName;
    address public Owner;
    address public contractAddress;
    uint256 public erc20balance;
    address public con;

    struct funder{
        address FunderAddress;
        uint256 FundingAmount;
    }
    ERC20Token token;
    constructor (
        string memory name,
        address _Owner,
        address _token
        // address contractAddress
        ) 
        {
            ContractName=name;
            Owner=_Owner;
            token= ERC20Token(_token);
            con=_token;
        }
    function pay() public payable {
        funding.push(funder(msg.sender,msg.value));
        token.transfer(msg.sender,msg.value);
    }
    function erc20token() public{
        erc20balance = token.balanceOf(address(this));
    }

    funder[] public funding;

    function totalValue() public view returns(uint256){
        return address(this).balance;
    }
    function withdraw(uint256 amount) public {
        require(msg.sender==Owner, "You Don't have Access to WithDraw");
        payable(Owner).transfer(amount);
    }
}","keccak256":"0x47ef363b7db31d06a89c024828322c35cbcb8da7139ea3f8d6cc06daeee59d2c","license":"MIT"}},"version":1}
